webpackJsonp([0xafa265e2d38b],{518:function(e,l){e.exports={data:{markdownRemark:{html:"<h1>Fields</h1>\n<p>Freelancers are the individual who work on the tasks defined in a project.\nFreelancer resources currently expose the following fields:</p>\n<ul>\n<li>id</li>\n<li>name</li>\n<li>email</li>\n<li>telephone</li>\n<li>country</li>\n<li>city</li>\n<li>area code</li>\n<li>currency</li>\n<li>next_available</li>\n<li>custom_data</li>\n<li>daily_rate</li>\n<li>hourly_rate</li>\n<li>instagram</li>\n<li>linkedin</li>\n<li>twitter</li>\n<li>website</li>\n<li>youtube</li>\n</ul>\n<p>The value of custom_data varries as a result of the set of onboarding templates assigned to the specific freelancer. These are a set of key and value data pairs provided by the customer which may include any type of unstructured data useful to the onboarding and management of the freelancer for example type of equipment, location availability, and banking preferences. The data will be returned as a collection of keys / values grouped by template name. </p>\n<h1>Endpoints</h1>\n<h2>GET /freelancers/</h2>\n<p>List all the available freelancers for the given team. The result is a paginated list of freelancers.</p>\n<h2>GET /freelancers/&#x3C;uuid:id>/</h2>\n<p>Retrienve a freelancer given the corresponding ID.</p>",fields:{slug:"/resources/freelancers/"},frontmatter:{title:"Freelancers"}}},pathContext:{slug:"/resources/freelancers/"}}}});
